import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter, Route } from 'react-router-dom'

import App from './App';

var Routes = (
	<BrowserRouter>
		<Route path="/" component={App}></Route>
	</BrowserRouter	>
);

module.exports = Routes;
